import React from "react";
import { Nav } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";

function CheckoutSteps({ step1, step2, step3, step4 }) {
    return (
        <div className="d-flex justify-content-between mb-4">
            <div className={step1 ? "font-weight-bold" : "text-muted"}>
                {step1 ? (
                    <Nav.Link to="/login">Login</Nav.Link>
                ) : (
                    "Login"
                )}
            </div>

            <div>{step2 ? <>&#8594;</> : null}</div>

            <div className={step2 ? "font-weight-bold" : "text-muted"}>
                {step2 ? (
                    <Nav.Link to="/shipping">Shipping</Nav.Link>
                ) : (
                    "Shipping"
                )}
            </div>

            <div>{step3 ? <>&#8594;</> : null}</div>

            <div className={step3 ? "font-weight-bold" : "text-muted"}>
                {step3 ? (
                    <Nav.Link to="/payment">Payment</Nav.Link>
                ) : (
                    "Payment"
                )}
            </div>

            <div>{step4 ? <>&#8594;</> : null}</div>

            <div className={step4 ? "font-weight-bold" : "text-muted"}>
                {step4 ? (
                    <Nav.Link to="/placeorder">Place Order</Nav.Link>
                ) : (
                    "Place Order"
                )}
            </div>
        </div>
    );
}

export default CheckoutSteps;
